package tcp

import (
	"fmt"
	"net"
	"sort"
	"strconv"
	"time"

	"github.com/HDN-1D10T/divinity/src/util"
)

func worker(ports, results chan int, host string) {
	for p := range ports {
		// log.Printf("Trying %s:%d...\n", host, p)
		address := fmt.Sprintf("%s:%d", host, p)
		conn, err := net.DialTimeout("tcp", address, 500*time.Millisecond)
		if err != nil {
			results <- 0
			continue
		}
		conn.Close()
		results <- p
	}
}

// Scan with native portscanner
func Scan(host string) {
	ports := make(chan int, 100)
	results := make(chan int)

	var openports []int

	for i := 0; i < cap(ports); i++ {
		go worker(ports, results, host)
	}
	// Single Port
	if len(*Conf.Port) > 0 {
		thePort, _ := strconv.Atoi(*Conf.Port)
		ports <- thePort
		port := <-results
		if port != 0 {
			openports = append(openports, port)
		}
		close(ports)
		close(results)
		sort.Ints(openports)
		for range openports {
			msg := host
			util.LogWrite(msg)
		}
		return
	}
	// All Ports
	if *Conf.All {
		go func() {
			for i := 1; i <= 65536; i++ {
				ports <- i
			}
		}()

		for i := 0; i < 65536; i++ {
			port := <-results
			if port != 0 {
				openports = append(openports, port)
			}
		}
		close(ports)
		close(results)
		sort.Ints(openports)
		for _, port := range openports {
			host := host
			msg := fmt.Sprintf("%s:%d", host, port)
			util.LogWrite(msg)
		}
		return
	}
	// Top Ports
	if *Conf.TopPorts {
		go func() {
			for i := 0; i < len(topPorts); i++ {
				ports <- topPorts[i]
			}
		}()

		for i := 0; i < len(topPorts); i++ {
			port := <-results
			if port != 0 {
				openports = append(openports, port)
			}
		}
		close(ports)
		close(results)
		sort.Ints(openports)
		for _, port := range openports {
			host := host
			msg := fmt.Sprintf("%s:%d", host, port)
			util.LogWrite(msg)
		}
		return
	}
	// 1024 Ports
	go func() {
		for i := 1; i < 1025; i++ {
			ports <- i
		}
	}()

	for i := 0; i < 1024; i++ {
		port := <-results
		if port != 0 {
			openports = append(openports, port)
		}
	}
	close(ports)
	close(results)
	sort.Ints(openports)
	for _, port := range openports {
		host := host
		msg := fmt.Sprintf("%s:%d", host, port)
		util.LogWrite(msg)
	}
}

